import React from "react";
import HTML from "./assest/html.png";
import CSS from './assest/css.png'
import JS from './assest/js.svg'

export default function skills() {
  return (
    <div>
      <section id="skills" className="skills-section">
        <h2>Skills</h2>
        <div className="skills-grid">
          <img src={HTML} alt="HTML5" title="HTML" />
          <img src={CSS}alt="CSS3" title="CSS" />
          <img src={JS} alt="JavaScript" title="JavaScript" />
          <img src={"/logos/react.png"} alt="React" title="React" />
          <img src="/logos/bootstrap.png" alt="Bootstrap" title="Bootstrap" />
          <img src="/logos/github.png" alt="GitHub" title="GitHub" />
          <img src="/logos/gsap.png" alt="GSAP" title="GSAP" />
        </div>
      </section>
    </div>
  );
}
